description:
The Football League Show 05.10.2013

Duration: 1 hour, 15 min

Manish Bhasin presents highlights from the Football League. Doncaster have found life back in the Championship hard going so far this season; this week they meet one of the favourites for promotion, Leicester City. Plus extended highlights from Saturday's early kick off as two big clubs in search of better days, Birmingham and Bolton, go head-to-head at St Andrew's.
